import { Fragment } from "react";
import Header from "./Components/Layers/Header";
import Meals from "./Components/Meal/Meals";
import Cart from "./Components/Cart/Cart";

const App = () => {
  const [modalshow, setmodalshow] = useState(false);
  return (
    <Fragment>
      {modalshow && <Cart />}
      <Header />
      <Meals />
    </Fragment>
  );
};

export default App;
